import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import youicon from './youtubex.jpg';

import Container from 'react-bootstrap/Container';
import {

  FacebookShareButton,


  LinkedinShareButton,

  TwitterShareButton,

  WhatsappShareButton,

} from "react-share";
import {

  FacebookIcon,



  LinkedinIcon,


  TwitterIcon,

  WhatsappIcon,

} from "react-share";














const FooterPage = () => {
  return (
    <div>




          <Container>
  <Row   style={{backgroundColor: 'lightblue'                 }}      >








    <Col sm={4} lg={12} md={12}    style={{backgroundColor: 'cyan', height: '200px' ,display: 'flex',justifyContent: '',
		alignItems: 'Right',
	}}   >

    < FacebookShareButton    url={'https://www.facebook.com/'}  title={'fallow'}  >  


          <FacebookIcon size={32} round={true} />  </ FacebookShareButton> &nbsp;&nbsp;

          < WhatsappShareButton    url={'https://web.whatsapp.com'}  title={'fallow'}  > 


          <WhatsappIcon size={32} round={true} />  </ WhatsappShareButton> 
          < TwitterShareButton    url={'https://twitter.com/'}  title={'fallow'}  >  &nbsp; &nbsp;


          <TwitterIcon size={32} round={true} />  </ TwitterShareButton> 
          < LinkedinShareButton   url={''}  title={'fallow'}  >  &nbsp; &nbsp;


          <LinkedinIcon size={32} round={true} />  </LinkedinShareButton> 






    </Col>
    <Col sm={4} lg={12} md={12}  style={{backgroundColor: 'white', height: '150px', paddingTop:'0px'}} > 

    <a  href={'https://www.youtube.com/channel/UCkgY5iy0Y4SqQustDKlee7g/videos'}  >   <img src={youicon} alt=""/> fallow us on youtube to watch all the helpful videos </a> </Col>





    <Col sm={4} lg={12} md={12}  style={{backgroundColor: 'blue', height: '50px'}}  >Third, but first</Col>
  </Row>
</Container>









      </div>

  );
}

export default FooterPage;
